import React from "react";
import Button from "@mui/material/Button";

const TaskStatusButton = ({ currentStatus, onStatusChange }) => {
  return (
    <Button variant="contained" onClick={onStatusChange}>
      {currentStatus}
    </Button>
  );
};

export default TaskStatusButton;
